import React from "react";

import "./CenteredContainer.css"
const CenteredContainer = props => {
    return (
        <div class="container centered-container">
            <div class="row">
                
                <div class="col-lg-6 col-sm-12">
                    One of three columns
                </div>
            </div>
        </div>
    );
};

export default CenteredContainer;
